CREATE TABLE IF NOT EXISTS "controls" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "recordId" TEXT NOT NULL,
    "parameterId" TEXT,
    "parameterName" TEXT NOT NULL,
    "fullRange" TEXT NOT NULL,
    "controlValue" REAL,
    "textControl" TEXT,
    "parameterType" TEXT,
    "observation" TEXT,
    "outOfRange" BOOLEAN NOT NULL DEFAULT false,
    "alertMessage" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT "controls_recordId_fkey" FOREIGN KEY ("recordId") REFERENCES "records" ("id") ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT "controls_parameterId_fkey" FOREIGN KEY ("parameterId") REFERENCES "parameters" ("id") ON DELETE SET NULL ON UPDATE CASCADE
);
